import React from "react";

function AddProject() {
  return (
    <div>
      <div>
        <form>
          <h2>Add Project</h2>
          <input name="projectName" type="text" />
          <input name="projectLeader" type="text" />
        </form>
      </div>
    </div>
  );
}

export default AddProject;
